struct InstrCoverage {
  const char *instrName;
  uint8_t encoding;
  uint16_t typesMask;
  uint16_t switchesMask;
  bool cover = false;
  InstrCoverage(const char *fn, uint8_t enc, uint16_t tm, uint16_t sm)
      : instrName(fn), encoding(enc), typesMask(tm), switchesMask(sm) {}
};

